export const tooglemain_menu = () => {
    let tooglebtn = document.querySelector("#topnav");
       if(tooglebtn.classList.contains("hidden"))
         { tooglebtn.classList.remove("hidden") }
        else { tooglebtn.classList.add("hidden") }
}
